// AlbumDetails.js
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const AlbumDetails = ({ album, onSongClick }) => {
  const { albumId } = useParams();
  // Additional AlbumDetails logic...

  const handleSongClick = (track) => {
    // Pass the selected song to the parent component
    onSongClick(track);
  };

  return (
    <div>
      {/* AlbumDetails content... */}
      <h2>{album.albumTitle}</h2>
      {/* Additional AlbumDetails content... */}
      <h3>Tracks:</h3>
      <ul>
        {album.tracklist.map(track => (
          <li key={track._id} onClick={() => handleSongClick(track)}>
            {track.name} - {track.duration}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AlbumDetails;
